import { useSelector } from 'react-redux';

const WinnerGraph = () => {
  const results = useSelector(({ quiz }) => quiz.results).slice(0, 3);

  return (
    <>
      {results.map(result => {
        return <p>{result.teamId} {result.score} {result.questionsCorrect}</p>
      })}
    </>
  );
};

export default WinnerGraph;
